import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function RegisterPage() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    idProof: null,
    photo: null,
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    if (files) {
      setFormData({ ...formData, [name]: files[0] });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("User Registered:", formData);

    // ✅ After registration go to login page
    navigate("/login");
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2 style={styles.title}>Register</h2>
        <form onSubmit={handleSubmit} style={styles.form}>
          <input
            type="text"
            name="name"
            placeholder="Full Name"
            value={formData.name}
            onChange={handleChange}
            required
            style={styles.input}
          />
          <input
            type="email"
            name="email"
            placeholder="Email"
            value={formData.email}
            onChange={handleChange}
            required
            style={styles.input}
          />
          <input
            type="password"
            name="password"
            placeholder="Password"
            value={formData.password}
            onChange={handleChange}
            required
            style={styles.input}
          />

          {/* ID Proof Upload */}
          <label style={styles.label}>Upload ID Proof (Aadhaar, Voter, Passport)</label>
          <input
            type="file"
            name="idProof"
            accept=".jpg,.jpeg,.png,.pdf"
            onChange={handleChange}
            required
            style={styles.fileInput}
          />

          {/* Passport Photo Upload */}
          <label style={styles.label}>Upload Passport Size Photo</label>
          <input
            type="file"
            name="photo"
            accept="image/*"
            onChange={handleChange}
            required
            style={styles.fileInput}
          />

          <button type="submit" style={styles.button}>Register</button>
        </form>
        <p style={styles.text}>
          Already have an account?{" "}
          <span
            style={styles.link}
            onClick={() => navigate("/login")}
          >
            Login here
          </span>
        </p>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex", justifyContent: "center", alignItems: "center",
    height: "100vh", backgroundColor: "#f4f6f9",
  },
  card: {
    background: "#fff", padding: "30px", borderRadius: "12px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.1)", width: "350px",
    textAlign: "center",
  },
  title: { marginBottom: "20px", color: "#333" },
  form: { display: "flex", flexDirection: "column" },
  input: {
    padding: "10px", marginBottom: "15px",
    borderRadius: "6px", border: "1px solid #ccc",
  },
  fileInput: {
    marginBottom: "15px",
  },
  button: {
    padding: "10px", background: "#4cafef", color: "#fff",
    border: "none", borderRadius: "6px", cursor: "pointer",
  },
  text: { marginTop: "15px", color: "#555" },
  link: { color: "#4cafef", cursor: "pointer", fontWeight: "bold" },
  label: { textAlign: "left", marginBottom: "5px", fontSize: "14px", color: "#333" }
};

export default RegisterPage;
